function Card(props) {
  const handleClick = (e) => {
    e.preventDefault();
    console.log(`${props.title} card was clicked`);
  };

  if (props.contentType === "text") {
    return (
      <div className="itemContainer cardTitle cardHidden" onClick={handleClick}>
        <h1>{props.title}</h1>
      </div>
    );
  } else if (props.contentType === "image") {
    return (
      <div className="itemContainer cardImage">
        <img src={props.image} />>
      </div>
    );
  }
}

export default Card;
